import loading from '../../img/loading.gif'
import './loading.css';

const Loading = () => {
    return (
        <div>
            <img src={loading} className="load" alt="Loading" />
            <span>
                <b>Looking... Please Wait</b>
            </span>
        </div>
    )
}

export default Loading;
